$(document).ready(function(){$("#buildingsList").change(function(){let n=$("#buildingsList option:selected").val();var t=n;$.ajax({type:"GET",data:t,url:"/BeneficiaryEntry/ListFloors",success:function(n){let t="";$.each(n,function(n,i){t+='<option value="'+i.value+'">'+i.text+"<\/option>"});$("#floorsList").html(t)}})})});